import React from "react";
import "./styles/SearchPopup.css";

export default function SearchPopup() {
  return (
    <div className="container-search-popup">
      <h2>Search</h2>
      <label>
        Destination
        <input type="text" />
      </label>

      <label>
        Check-in Date
        <input type="text" />
      </label>
    </div>
  );
}
